    [],nt"revision_timestamp": "2015-07-23T03:29:57.596675",nt"name": "flint-hills-national-wildlife-refuge-and-marais-des-cygnes-national-wildlife-refuge-annua--469c7",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Flint
    National Wildlife Refuge and Marais Des Cygnes National Wildlife Refuge summarizes
    refuge activities during the 1996 calendar year.  The report begins with a summary
    of the years highlights and climatic conditions.  The report includes a planning
    section which discusses master plan, management plans, compliance with environmental
    an cultural resource mandate.  Refuge administration is outlined; information about
    personnel, youth programs, other manpower programs, volunteer programs, funding,
    safety, and other items is given.  Habitat management is also covered.  Subjects
    include wetlands, forests, croplands, grasslands, other habitats, haying, fire management,
    pest control, and water rights .  The wildlife section of the report discusses endangered
    andor threatened species waterfowl, marsh and water birds, shorebirds, gulls, terns
    and allied species, raptors, other migratory birds, game mammals, other resident
    wildlife, fisheries resources, and scientific collections.  The public uses of the
    refuge described in this report include general, outdoor student classrooms, interpretive
    foot trails, interpretive exhibits demonstrations, hunting, fishing, wildlife observation,
    other wildlife oriented recreation, picnicking, other nonwildlife oriented recreation,
    and law enforcement.  The equipment and facilities section of the report provides
    information about new construction, rehabilitation, equipment utilization and replacement,
    communications systems, and computer systems.  Items of interest are provided at
    the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
